<template>
  <div>
    <ion-card>
      <ion-card-content>
        <van-config-provider :theme-vars="themeVars">
          <van-cell is-link @click="showPopup" icon="plus" title="添加反馈信息"></van-cell>
        </van-config-provider>
      </ion-card-content>
    </ion-card>

    <van-popup v-model:show="show" round :style="{ padding: '50px' }">
      <!-- 可以使用 CellGroup 作为容器 -->
      <van-cell-group inset>
        <van-field v-model="question" label="问题描述：" placeholder="请输入问题描述" />
        <van-field v-model="description" label="详细描述：" placeholder="请输入详细问题描述" />
      </van-cell-group>
      <van-button type="primary" @click="confirm" class="l">确认</van-button>
      <van-button type="primary" @click="cancle" class="r">取消</van-button>
    </van-popup>

    <ion-card v-for="item in items" :key="item.qid">
      <div class="left">
        <ion-card-header>
          <ion-card-title>问题编号：{{ item.qid }}</ion-card-title>
          <ion-card-subtitle>问题描述：{{ item.question }}</ion-card-subtitle>
        </ion-card-header>
        <ion-card-content>
          <p> 详细描述：{{ item.description }}</p>
          <p>创建日期：{{ formatDate(item.createDate) }}</p>
        </ion-card-content>
      </div>

      <div class="photo">
        <img :src="setphoto(item.status)">
      </div>
    </ion-card>
  </div>
</template>

<script setup lang="ts">
import { ref, reactive } from 'vue';
import { IonCardContent, IonCardHeader, IonCardTitle, IonCard, alertController, IonCardSubtitle } from "@ionic/vue";

interface Question {
  qid: number;
  question: string;
  description: string;
  picture: string;
  createDate: string;
  sponsor: string;
  teleinfo: string;
  principal: string;
  status: number;
}
const setphoto = (status: number) => {
  if (status === 0) {
    return "data:image/png;base64,";
  } else if (status === 1) {
    return "data:image/png;base64,";
  } else if (status === 2) {
    return "data:image/png;base64,";
  }
  else if (status === 3) {
    return "data:image/png;base64,";
  }
  else if (status === 4) {
    return "data:image/png;base64,";
  }
  else {
    return "";
  }
}
const formatDate = (dateString?: string) => {
  if (!dateString) {
    return '';
  }
  const date = new Date(dateString);
  const year = date.getFullYear();
  const month = date.getMonth() + 1;
  const day = date.getDate();
  return `${year}年${month}月${day}日`;
}

const items = ref<Question[]>([]);
const themeVars = reactive({
  cellHorizontalPadding: '0px',
  cellFontSize: '16px',
  cellTextColor: '#000',
  cellIconSize: '30px',
})
const question = ref('');
const description = ref('');


const showPopup = () => {
  show.value = true;
};
const confirm = async () => {
  if (question.value === '' || description.value === '') {
    const alert = alertController.create({
      header: '添加失败',
      subHeader: '信息不完整',
      message: '请检查信息是否完整',
      buttons: ['确定'],
    });
    (await alert).present();
    return;
  }
  const mHeaders = new Headers();
  mHeaders.append("User-Agent", "Apifox/1.0.0 (https://www.apifox.cn)");
  mHeaders.append("Content-Type", "application/json");

  const naw = JSON.stringify({
    "question": question.value,
    "description": description.value,
    "sponsor": document.cookie.split(';').filter((item) => item.includes('eid'))[0].split('=')[1],
  });

  // eslint-disable-next-line no-undef
  const requestOption: RequestInit = {
    method: 'POST',
    headers: mHeaders,
    body: naw,
    redirect: 'follow'
  };

  fetch("http://127.0.0.1:6521/api/feedback/add", requestOption)
    .then(response => response.text())
    .then(result => console.log(result))
    .catch(error => console.log('error', error));
  show.value = false;
};
const cancle = () => {
  show.value = false;
};
const show = ref(false);
const loadfeedback = () => {
  const myHeaders = new Headers();
  myHeaders.append("User-Agent", "Apifox/1.0.0 (https://www.apifox.cn)");

  // eslint-disable-next-line no-undef
  const requestOptions: RequestInit = {
    method: 'POST',
    headers: myHeaders,
    redirect: 'follow'
  };
  fetch("http://127.0.0.1:6521/api/feedback/list?eid=" + document.cookie.split(';').filter((item) => item.includes('eid'))[0].split('=')[1], requestOptions)
    .then(response => response.text())
    .then(result => {
      JSON.parse(result).code === "SE200" ? console.log('success') : console.log('fail');
      items.value = JSON.parse(JSON.parse(result).data)
    })
    .catch(error => console.log('error', error));
}
loadfeedback();
</script>

