   width: 100px;
   height: 100px;
   display: flex;
   justify-content: center;
   align-items: center;
   /* position: absolute; */
   float: right;
 }

 .left {
   float: left;
   width: 70%;
 }

 .r {
   float: right;
   margin-right: 20px;
 }

 .l {
   float: left;
   margin-left: 20px;
 }

 ion-card-header.ios {
   display: flex;
   flex-flow: column-reverse;
 }
